    (function() {
        var m = [0, 0, 0, 0],
            w = 1200,
            h = 700,
            i = 0,
            tree,
            diagonal,
            root;

        var domEight = "../data/dom-structure-jw8.json";

        var domSeven = "../data/dom-structure-jw7.json";

        // TODO: THIS IS A TEMPORARY SAFEGUARD.
        // Must create an elegant way of protecting other pages without d3 from the logic below.
        if (typeof d3 === 'undefined') {
            return;
        }

        tree = d3.layout.tree()
            .size([h, w]);

        diagonal = d3.svg.diagonal()
            .projection(function(d) { return [d.y, d.x]; });

        if ($('#jw8-json').length) {

            var vis = d3.select("#dom-visualization").append("svg:svg")
                .attr("width", w)
                .attr("height", h)
                .append("svg:g")

            d3.json(domEight, function(json) {
                root = json;
                root.x0 = h;
                root.y0 = w;

                function toggleAll(d) {
                    if (d.children) {
                        d.children.forEach(toggleAll);
                        toggle(d);
                    }
                }

                update(root);
            });

        }

        if ($('#jw7-json').length) {

            var vis = d3.select("#dom-visualization").append("svg:svg")
                .attr("width", w)
                .attr("height", h)
                .append("svg:g")

            d3.json(domSeven, function(json) {
                root = json;
                root.x0 = h;
                root.y0 = w;

                function toggleAll(d) {
                    if (d.children) {
                        d.children.forEach(toggleAll);
                        toggle(d);
                    }
                }

                update(root);
            });
        }

        function update(source) {
            var duration = d3.event && d3.event.altKey ? 5000 : 500;

            // Compute the new tree layout.
            var nodes = tree.nodes(root).reverse();

            // Normalize for fixed-depth.
            nodes.forEach(function(d) { d.y = d.depth * 200 + 20; });

            // Update the nodes
            var node = vis.selectAll("g.node")
                .data(nodes, function(d) { return d.id || (d.id = ++i); });

            // Enter any new nodes at the parent's previous position.
            var nodeEnter = node.enter().append("svg:g")
                .attr("class", "node")
                .attr("transform", function(d) { return "translate(" + source.y0 + "," + source.x0 + ")"; })
                .on("click", function(d) { toggle(d); update(d); });

            nodeEnter.append("svg:circle")
                .attr("r", 1e-6)
                .style("fill", function(d) { return d._children ? "#FFB600" : "#FF4664"; });

            nodeEnter.append('a')
                .attr('xlink:href', function(d) {
                    return d.url;
                })
                .append("svg:text")
                .attr("x", function(d) { return d.children || d._children ? +20 : 20; })
                .attr("dy", ".35em")
                .attr("text-anchor", function(d) { return d.children || d._children ? "start" : "start"; })
                .text(function(d) { return d.name; })
                //styling for text for nodes
                .style('fill', function(d) {
                    return d.color ? '#fff' : '#AAB4C8';
                })
                .style("fill-opacity", 1e-6);

            nodeEnter.append("svg:title")
                .text(function(d) {
                    return d.description;
                });

            // Transition nodes to their new position.
            var nodeUpdate = node.transition()
                .duration(duration)
                .attr("transform", function(d) { return "translate(" + d.y + "," + d.x + ")"; });

            nodeUpdate.select("circle")
                .attr("r", 6)
                // styling for circle nodes, filled color on collapse : fill color expanded
                .style("fill", function(d) { return d._children ? "#2BBECF" : "#475470"; });

            nodeUpdate.select("text")
                .style("fill-opacity", 1);

            // Transition exiting nodes to the parent's new position.
            var nodeExit = node.exit().transition()
                .duration(duration)
                .attr("transform", function(d) { return "translate(" + source.y + "," + source.x + ")"; })
                .remove();

            nodeExit.select("circle")
                .attr("r", 1e-6);

            nodeExit.select("text")
                .style("fill-opacity", 1e-6);

            // Update the links
            var link = vis.selectAll("path.link")
                .data(tree.links(nodes), function(d) { return d.target.id; });

            // Enter any new links at the parent's previous position.
            link.enter().insert("svg:path", "g")
                .attr("class", "link")
                .attr("d", function(d) {
                    var o = {x: source.x0, y: source.y0};
                    return diagonal({source: o, target: o});
                })
                .transition()
                .duration(duration)
                .attr("d", diagonal);

            // Transition links to their new position.
            link.transition()
                .duration(duration)
                .attr("d", diagonal);

            // Transition exiting nodes to the parent's new position.
            link.exit().transition()
                .duration(duration)
                .attr("d", function(d) {
                    var o = {x: source.x, y: source.y};
                    return diagonal({source: o, target: o});
                })
                .remove();

            // Stash the old positions for transition.
            nodes.forEach(function(d) {
                d.x0 = d.x;
                d.y0 = d.y;
            });
        }

        // Toggle children.
        function toggle(d) {
            if (d.children) {
                d._children = d.children;
                d.children = null;
            } else {
                d.children = d._children;
                d._children = null;
            }
        }
    }());

