            var $description = $('<div>', {class: "details-release-description single-release"});
            var $version = $('<p class="version">' + release.tag_name + '</p>');
            var html = convertMarkdown(release.body);
            var fixesList = [];

            $releaseWrap.append($version);
            $releaseWrap.append($name);
            $releaseWrap.append($description);
            $description.html(html);
